def clinical_preprocess_function(examples):
    try:
        # Multi-stage processing
        inputs = [preprocessor.enhance_context(text) for text in examples['Prompt']]

        # Clinical-aware tokenization
        model_inputs = tokenizer(
            inputs,
            max_length=400,
            truncation='longest_first',
            padding='max_length',
            add_special_tokens=True,
            return_attention_mask=True
        )

        # Structured target generation
        targets = [f"<DX> {preprocessor.clean_text(t)}" for t in examples['GPT4.0']]

        labels = tokenizer(
            text_target=targets,
            max_length=300,
            truncation=True,
            padding='max_length',
            add_special_tokens=True
        )

        model_inputs["labels"] = labels["input_ids"]
        return model_inputs
    except Exception as e:
        print(f"Error processing batch: {str(e)}")
        raise

