# Hyperparameter tuning
def objective(trial):
    params = {
        'n_estimators': trial.suggest_int('n_estimators', 100, 1000),
        'max_depth': trial.suggest_int('max_depth', 3, 9),
        'learning_rate': trial.suggest_float('learning_rate', 0.001, 0.3),
        'subsample': trial.suggest_float('subsample', 0.6, 1.0),
        'reg_lambda': trial.suggest_float('reg_lambda', 0.1, 10)  # Added regularization
    }
    model = XGBClassifier(**params)
    X_train, X_val, y_train, y_val = train_test_split(X, y, test_size=0.2, stratify=y)
    model.fit(X_train, y_train, early_stopping_rounds=20, eval_set=[(X_val, y_val)], verbose=0)
    return accuracy_score(y_val, model.predict(X_val))

study = optuna.create_study(direction='maximize')
study.optimize(objective, n_trials=50, timeout=3600)  # 1 hour limit

